        const grid = document.getElementById('grid');
        const modal = document.getElementById('modal');

        const modalTitle = document.getElementById('modal-title');
        
        // GÃ©nÃ¨re les cards (lazy)
        function renderGrid(filter = '') {
            grid.innerHTML = '';
            urls.filter(u => u.toLowerCase().includes(filter.toLowerCase())).forEach(url => {
                const filename = url.split('/').pop();
                const card = document.createElement('div');
                card.className = 'card';
                card.innerHTML = `
                    <div style="height:180px; background:#334155; display:flex; align-items:center; justify-content:center; color:#64748b;">
                        <span style="font-size:48px;">ðŸŽžï¸</span>
                    </div>
                    <h3>${filename}</h3>
                `;
                card.onclick = () => {
                    player.src = url;
                    modalTitle.textContent = filename;
                    modal.style.display = 'flex';
                    player.play();
                };
                grid.appendChild(card);
            });
        }
        
        // Search
        document.getElementById('search').addEventListener('input', (e) => {
            renderGrid(e.target.value);
        });
        
        // Close modal
        function closeModal() {
            player.pause();
            player.src = '';
            modal.style.display = 'none';
        }
        modal.onclick = (e) => { if (e.target === modal) closeModal(); };
        
        // Init
        renderGrid();
    </script>
